var souris    setTimeout(function () { 
      var xmlns = "http://www.w3.org/2000/svg"
      for(i = 0; 8000 > i; i++) {
         var restex = (i%100)*5
         var restey = (i*1-restex*0.2)/20
         var recto = document.createElementNS(xmlns,"rect");
         recto.setAttribute("x", restex);
         recto.setAttribute("y", restey);
         recto.setAttribute("height", 5);
         recto.setAttribute("width", 5);
         recto.setAttribute("fill", "#ffb229");
         recto.setAttribute("onmouseover", "souriscolorize(evt)");
         recto.setAttribute("onmousedown", "souris = false");
         recto.setAttribute("onmouseup", "souris = true");
         recto.setAttribute("onclick", "colorize(evt)");
         recto.setAttribute("concentration", "0");
         recto.setAttribute("nouveletat", "0");
         recto.setAttribute("concentration2", "0");
         recto.setAttribute("nouveletat2", "0");
         recto.setAttribute("id", "z"+i*1);
         document.getElementById("tango").appendChild(recto);
    }
  }, 22)
