    function colorize(evt) {
      var zible = evt.target
      zible.setAttribute("fill", "#ff8870");
      zible.setAttribute("concentration", 100);
      zible.setAttribute("concentration2", 100);
  }
    function souriscolorize(evt) {
      var zible = evt.target
      var mystere = Math.round(Math.random()*3)
      if (souris == false)
         if (mystere == 1)
            zible.setAttribute("concentration", 100);
         else if (mystere == 2)
            zible.setAttribute("concentration", 100);
         else
            zible.setAttribute("concentration", 100);
      else
         null;
      if (souris == false)
         if (mystere == 1)
            zible.setAttribute("fill", "#ff8870");
         else if (mystere == 2)
            zible.setAttribute("fill", "#ff8870");
         else
            zible.setAttribute("fill", "#ff8870");
      else
         null;
      if (souris == false)
         if (mystere == 1)
            zible.setAttribute("concentration2", 100);
         else if (mystere == 2)
            zible.setAttribute("concentration2", 100);
         else
            zible.setAttribute("concentration2", 100);
      else
         null;
  }
